import React, { useState } from 'react';
import { Clapperboard, Code, Film, User } from 'lucide-react';

function App() {
  const [activeSection, setActiveSection] = useState('compositing');

  const renderContent = () => {
    switch (activeSection) {
      case 'compositing':
        return (
          <div className="space-y-8">
            <h1 className="text-4xl font-bold">Compositing</h1>
            <p className="text-lg">Specialized in creating seamless visual effects and integrations using Nuke. Extensive experience in film production and advertising projects.</p>
            <div className="space-y-4">
              <div className="border border-white/10 p-4 rounded">
                <h2 className="text-2xl">Project Alpha</h2>
                <p>Visual effects for major film production</p>
              </div>
              <div className="border border-white/10 p-4 rounded">
                <h2 className="text-2xl">Commercial Work</h2>
                <p>Commercial projects and advertising</p>
              </div>
              <div className="border border-white/10 p-4 rounded">
                <h2 className="text-2xl">Film Integration</h2>
                <p>Seamless visual effects integration</p>
              </div>
            </div>
          </div>
        );
      case 'technical':
        return (
          <div>
            <h1 className="text-4xl font-bold">Technical Direction</h1>
          </div>
        );
      case 'motion':
        return (
          <div>
            <h1 className="text-4xl font-bold">Motion Design</h1>
          </div>
        );
      case 'personal':
        return (
          <div>
            <h1 className="text-4xl font-bold">Personal Projects</h1>
          </div>
        );
      default:
        return null;
    }
  };

  return (
    <div className="min-h-screen bg-black text-white">
      <header className="fixed top-0 left-0 right-0 bg-black border-b border-white/10">
        <div className="container mx-auto px-4">
          <div className="flex items-center h-16 space-x-8">
            <div className="font-bold text-xl">MT</div>
            <nav className="flex space-x-4">
              <button 
                onClick={() => setActiveSection('compositing')}
                className={`flex items-center space-x-2 px-4 py-2 rounded transition-colors ${
                  activeSection === 'compositing' ? 'bg-white text-black' : 'text-white/60 hover:text-white'
                }`}
              >
                <Clapperboard size={20} />
                <span>Compositing</span>
              </button>
              <button 
                onClick={() => setActiveSection('technical')}
                className={`flex items-center space-x-2 px-4 py-2 rounded transition-colors ${
                  activeSection === 'technical' ? 'bg-white text-black' : 'text-white/60 hover:text-white'
                }`}
              >
                <Code size={20} />
                <span>Technical</span>
              </button>
              <button 
                onClick={() => setActiveSection('motion')}
                className={`flex items-center space-x-2 px-4 py-2 rounded transition-colors ${
                  activeSection === 'motion' ? 'bg-white text-black' : 'text-white/60 hover:text-white'
                }`}
              >
                <Film size={20} />
                <span>Motion</span>
              </button>
              <button 
                onClick={() => setActiveSection('personal')}
                className={`flex items-center space-x-2 px-4 py-2 rounded transition-colors ${
                  activeSection === 'personal' ? 'bg-white text-black' : 'text-white/60 hover:text-white'
                }`}
              >
                <User size={20} />
                <span>Personal</span>
              </button>
            </nav>
          </div>
        </div>
      </header>
      <main className="container mx-auto px-4 pt-24">
        {renderContent()}
      </main>
    </div>
  );
}

export default App;
